const IMDbPro = () => {
  return (
    <h1
      style={{
        fontSize: "1.3rem",
        lineHeight: 0,
      }}
    >
      <span
        style={{
          color: "white",
          fontFamily: "sans-serif",
          letterSpacing: -2,
        }}
      >
        IMDb
      </span>
      <span
        style={{
          color: "rgb(0, 192, 218)",
          fontFamily: "sans-serif",
          letterSpacing: -3,
        }}
      >
        Pro
      </span>
    </h1>
  );
};

export default IMDbPro;
